  <div className="code_container">
    <p><b>public class </b><span className="main_words">Welcome</span> {openKey}</p>
    <p><b>public static void</b> <span className="main_words">main</span>(String[] args) {openKey}</p>
    <p>System.out.println( <span className="string_word">"Pulsa el bot√≥n ejecutar"</span>)</p>
    <p>{closeKey}</p>
    <p>{closeKey}</p>
  </div>

  );
}

export default Landing;
